/* eslint-disable react/jsx-no-comment-textnodes */
import React, { useState, useContext } from "react";
import {
  CardImg,
  CardTitle,
  CardSubtitle,
  CardBody,
  CardText,
  Row,
  Col,
  Card,
} from "reactstrap";
import styled from "styled-components";
import Link from "next/link";
import { birthContext } from "../../context/birth";
import { observer } from "mobx-react-lite";
import { signinUpContext } from "../../context/signinup";
import Router from "next/router";
const cardlist = observer((title, index, props) => {
  console.log(index);
  const birthInfo = useContext(birthContext);
  const signInfo = useContext(signinUpContext);
  console.log();
  const inputBirthNumber = (num) => {
    birthInfo.postNumber = num;

    birthInfo.simpleContentsSearch();
    birthInfo.title = "";
    birthInfo.subtitle = "";
    birthInfo.contents = "";
  };
  const CardTitleSize = styled(CardTitle)`
    font-size: 1.2em;
    font-weight: bold;
  `;
  const LinkFontStyle = styled(Link)`
    color: black;
    text-decoration: none;
    &:hover {
      color: black;
      text-decoration: none !important;
    }
  `;

  console.log(title.title);
  console.log(title.num);
  console.log(title.imgName);
  // console.log(key);
  const loginState = () => {};
  return (
    <div>
      {/*첫번째 요소*/}

      <div>
        {signInfo.kakaoId === "" ? (
          <>
            <LinkFontStyle to="/birth">
              <Card
                inverse
                style={{ backgroundColor: "#00D3EE", border: "0px" }}
                onClick={() => inputBirthNumber(title.num)}
              >
                <CardImg
                  top
                  width="100%"
                  src={title.image}
                  alt="Card image cap"
                />
                <CardBody>
                  <CardTitleSize>{title.title}</CardTitleSize>
                </CardBody>
              </Card>
              <br />
            </LinkFontStyle>
            <br />
          </>
        ) : (
          <>
            {/*} <LinkFontStyle href= "/result?month="+
     {birthInfo.birth_month}  +
      "&day=" +
     { birthInfo.birth_day} +
      "&dbname" +
        {birthInfo.dbName}>*/}

            <Card
              inverse
              style={{ backgroundColor: "#00D3EE", border: "0px" }}
              onClick={loginState}
            >
              <CardImg
                top
                width="100%"
                src={title.image}
                alt="Card image cap"
              />
              <CardBody>
                <CardTitleSize>{title.title}</CardTitleSize>
              </CardBody>
            </Card>
            <br />
            {/* </LinkFontStyle>*/}
          </>
        )}
      </div>
    </div>
  );
});

export default cardlist;
